Der Automat steht beim Wirtshaus zum Zauberwald auf dem Parkplatz vor einer Holzhütte. Das Wirtshaus ist angeschrieben da es etwas versteckt liegt.
Die Adresse ist: 
Im Zauberwald 5, 83486 Ramsau;

Kiel-Holtenau (Wik) Schleuse, Uferstrasse, Aussichtspunkt; 
Öffnungszeiten von Sonnenaufgang bis Sonnenuntergang;
Eintritt € 1,00

Der Automat steht der Kasse gegenüber, Daalhemerweg 31a.
Die Kasse ist zu erreichen über den Eingang der Steenkolenmijn, am Ende (beim Präger der Steenkolenmijn 
 ) rechts und dann rechts die Treppe hinauf zur Brasserie/Kasse/Toiletten oder über die "Feestgrot Valkenburg Brasserie" und dann die Treppe hinunter.
